import React from 'react';

const Content = () => {
    return (
        <div className="content--main">
            <iframe width="708" height="398" src="https://www.youtube.com/embed/i_0ewC_4eR0" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}

export default Content;
